import React from 'react';
import './ExpEduInfo.css';

class ExpEduInfo extends React.Component{
	constructor(props){
		super(props);
		this.state = {education: []};
	}
	render(){
		return(			
				<div className="moreInfoDiv">
				    <div className="divStyle">
				        {this.props.edu.position.map(e =>
				        <p>e.position</p>
				        )}
				    	<p>Experience</p>
				    	<h5 class="card-title">{this.props.edu.position}</h5>
			            <h6 class="card-subtitle mb-2 text-muted">steve@apple.com</h6>
			            <p class="card-text">Stay Hungry, Stay Foolish</p>
				    </div>
				    <div>
				    	<p>Education</p>
				    </div>
				</div>
				);
	}

}

export default ExpEduInfo;
